import React from 'react';
import ClientCard from './ClientCard';
import ColabsCard from './ColabsCard';

const Clients = () => {
  return (
    <>
      <div className="clients-container">
        <h2>Clientes</h2>
        <div className="client-cards">
          <img src="image1.jpg" alt="Client 1" />
          <img src="image2.jpg" alt="Client 2" />
          <img src="image3.jpg" alt="Client 3" />
          <img src="image4.jpg" alt="Client 4" />
          <img src="image5.jpg" alt="Client 5" />
        </div>
      </div>
    </>
  );
};

export default Clients;
